                    { 236, 4.9000000000000004, 1, "Black", 14, "The Mercedes-Benz S-Class (W223), a pinnacle of luxury and engineering excellence, continues its legacy in the year 2022. Renowned for its opulent features, cutting-edge technology, and refined performance, the S-Class remains a symbol of sophistication and prestige. The exterior design of the S-Class (W223) strikes a balance between timeless elegance and modern aesthetics. The body lines exude a sense of fluidity and strength, while the meticulously crafted details showcase the brand's commitment to perfection. Inside, the cabin offers an oasis of comfort and luxury. Premium materials, exquisite craftsmanship, and advanced features create an ambiance that indulges the senses. Mercedes-Benz's latest innovations are seamlessly integrated into the S-Class. The state-of-the-art MBUX infotainment system greets occupants with intuitive controls, voice commands, and a futuristic digital cockpit. Augmented reality navigation, AI-powered predictive functions, and customizable displays elevate the driving experience. Under the hood, the S-Class offers an array of potent powertrains, catering to diverse preferences. From refined gasoline and diesel engines to electrified options, each variant delivers a harmonious blend of power and efficiency. The advanced suspension system ensures a smooth and controlled ride, even on challenging road surfaces. Mercedes-Benz's commitment to safety is exemplified by the S-Class (W223). The vehicle incorporates an array of advanced driver assistance systems, including adaptive cruise control, lane-keeping assist, automatic emergency braking, and more. These features work together to enhance driver confidence and mitigate potential risks. The S-Class is renowned for introducing groundbreaking innovations, and the W223 is no exception. It boasts technologies such as E-Active Body Control, which uses cameras to scan the road and adjust the suspension accordingly, providing unparalleled comfort and stability. In conclusion, the Mercedes-Benz S-Class (W223) exemplifies the brand's dedication to luxury, technology, and performance. As a flagship model, it continues to set the standard for the automotive industry, redefining what it means to travel in style and comfort. With its timeless design and cutting-edge features, the S-Class remains an icon of automotive excellence in the year 2022.", 2999.0, 0.69999999999999996, 4, 365.0, "https://www.auto-data.net/images/f94/Mercedes-Benz-S-class-W223.jpg", "Mercedes-Benz", "S-Class (W223)", 175000.0, 700.0, null, null, null, 250.0, 500.0, 1, 2345.0, 2022 },
                    { 237, 12.9, 3, "black", 14, "The VW Golf 5, launched in 2004, is a part of Volkswagen's renowned Golf lineup. It blends practicality, reliability, and driving enjoyment seamlessly. With a design that balances aesthetics and modern simplicity, the Golf 5's compact dimensions offer style without sacrificing functionality. Inside, the cabin emphasizes user-friendly controls, comfortable seating, and ample cargo space. Under the hood, the Golf 5 presents a range of engine options, each delivering a mix of efficiency and performance. Responsive steering and a well-tuned suspension contribute to a confident driving experience. While not equipped with the latest technology, the Golf 5's interior provides essential comforts, reflecting Volkswagen's commitment to quality. In terms of safety, the Golf 5 incorporates airbags, anti-lock brakes, and stability control for occupant protection. As a significant iteration in the Golf lineup, the Golf 5 upholds the model's reputation for reliability and practicality, appealing to drivers seeking an affordable and dependable option. In summary, the 2004 VW Golf 5 remains a symbol of reliability and practicality within the compact car segment. Its enduring design, balanced performance, and comfort continue to exemplify Volkswagen's dedication to meeting diverse driver needs.", 1896.0, 6.5, 1, 90.0, "https://www.auto-data.net/images/f118/Volkswagen-Golf-V.jpg", "VW", "Golf 5", 6200.0, 40.0, null, null, null, 176.0, 210.0, 1, 1285.0, 2004 },
                    { 238, 10.1, 3, "Red", 21, "The Skoda Fabia III, introduced in 2018 by Skoda, embodies practicality, efficiency, and modern design in the compact car segment. With its sleek exterior and contemporary lines, the Fabia III boasts a design that merges aesthetics with functionality. The compact dimensions make it maneuverable in urban environments while offering ample interior space for passengers and cargo. Under the hood, the Fabia III offers a range of efficient engines, catering to both city commuting and longer journeys. Its balanced performance strikes a chord between fuel efficiency and driving enjoyment. The cabin of the Fabia III reflects Skoda's commitment to user-centered design. The interior space is intelligently organized, providing ergonomic seating and intuitive controls. Modern connectivity features ensure a convenient driving experience. In terms of safety, the Fabia III is equipped with standard airbags, anti-lock brakes, stability control, and more. While not the most advanced in terms of safety tech, it delivers a reassuring level of protection. As a part of Skoda's lineup, the Fabia III aligns with the brand's reputation for reliability and practicality. It's an ideal choice for drivers seeking a compact car that effortlessly combines style and functionality. In conclusion, the 2018 Skoda Fabia III stands as a testament to Skoda's commitment to producing compact cars that excel in practicality and efficiency. With its modern design, well-organized interior, and balanced performance, the Fabia III remains a relevant choice for drivers looking for a reliable and stylish urban companion.", 2993.0, 5.5999999999999996, 2, 110.0, "https://www.auto-data.net/images/f76/Skoda-Fabia-III-facelift-2018.jpg", "Skoda", "Fabia III", 24000.0, 130.0, null, null, null, 195.0, 200.0, 2, 1957.0, 2018 },
                    { 239, 6.7999999999999998, 4, "Dark blue", 14, "The Lexus RX IV, introduced in 2016 by Lexus, is a luxury SUV that blends sophistication, advanced technology, and comfort in a seamless package. Characterized by its bold and distinctive design, the RX IV commands attention on the road. The sharp lines and signature Lexus spindle grille contribute to its upscale presence, while the attention to detail showcases the brand's commitment to craftsmanship. Inside the RX IV, the cabin offers a sanctuary of luxury and modernity. High-quality materials, exquisite finishes, and meticulously crafted details create an ambiance that indulges the senses. The intuitive layout and user-friendly controls contribute to an effortless driving experience. Under the hood, the RX IV offers a range of powerful and efficient engine options, delivering both performance and fuel economy. The advanced suspension system ensures a smooth and composed ride, making it well-suited for both city driving and long journeys. Lexus is synonymous with cutting-edge technology, and the RX IV is no exception. It incorporates a suite of advanced features, including a user-friendly infotainment system, driver assistance technologies, and a premium sound system, elevating the driving experience to new heights. In terms of safety, the RX IV is equipped with a comprehensive set of features, including adaptive cruise control, lane departure warning, automatic emergency braking, and more. These systems work in harmony to enhance driver confidence and mitigate potential risks. As a flagship SUV in Lexus's lineup, the RX IV exemplifies the brand's dedication to luxury and innovation. Its combination of bold design, refined interior, and advanced technology positions it as a compelling choice in the luxury SUV segment. In conclusion, the 2016 Lexus RX IV is a testament to Lexus's pursuit of excellence in luxury and performance. With its distinctive design, opulent interior, and state-of-the-art tec