                    { 241, 10.699999999999999, 5, "Red", 21, "The Kia Optima IV, introduced in 2018, is a midsize sedan that showcases Kia's commitment to style, technology, and value. With its modern exterior design, the Optima IV captures attention on the road. Sleek lines and a bold front grille create an assertive presence, while the attention to aerodynamics contributes to its efficiency. Inside the Optima IV, the cabin offers a blend of comfort and technology. High-quality materials and well-crafted surfaces create an inviting atmosphere. The intuitive infotainment system provides connectivity and entertainment features that enhance the driving experience. Under the hood, the Optima IV offers a range of engine options, catering to different preferences for performance and fuel efficiency. The sedan's well-balanced suspension and responsive steering contribute to a confident and enjoyable driving dynamic. In terms of safety, the Optima IV is equipped with a suite of features, including adaptive cruise control, automatic emergency braking, lane departure warning, and more. These features work together to enhance driver confidence and mitigate potential risks. As a part of Kia's lineup, the Optima IV represents the brand's commitment to delivering value without compromising on style and technology. It's a practical choice for drivers seeking a midsize sedan that offers a combination of comfort, performance, and safety. In conclusion, the 2018 Kia Optima IV reflects Kia's dedication to providing a well-rounded midsize sedan. With its modern design, comfortable interior, and advanced safety and technology features, the Optima IV remains a relevant choice for drivers who prioritize style and practicality in their daily commute.", 2993.0, 10.1, 2, 163.0, "https://www.auto-data.net/images/f56/Kia-Optima-IV-Sportswagon-facelift-2018.jpg", "Kia", "Optima IV", 3900.0, 360.0, null, null, null, 205.0, 196.0, 1, 1625.0, 2018 },
                    { 242, 6.4000000000000004, 1, "Black", 14, "The BMW E60, introduced in 2010, is a representation of BMW's commitment to luxury, performance, and driving pleasure in the midsize sedan category. With its iconic design, the E60 carries BMW's distinctive styling cues. The elegant yet dynamic lines of the exterior showcase a timeless aesthetic that blends sophistication with athleticism. Inside, the cabin of the E60 offers a driver-focused environment. High-quality materials, precision craftsmanship, and ergonomic design create a space that exudes luxury and comfort. The intuitive controls and advanced infotainment system contribute to an engaging driving experience. Under the hood, the E60 offers a range of powerful engine options, each delivering the performance and refinement expected from a BMW. The sedan's responsive handling and well-tuned suspension system provide a dynamic driving experience that balances comfort and sportiness. Safety features in the E60 include airbags, stability control, and advanced braking systems, which contribute to occupant protection and peace of mind while on the road. As part of BMW's lineup, the E60 upholds the brand's legacy of engineering excellence and driving dynamics. It's an appealing choice for drivers who seek a midsize sedan that offers a blend of luxury, performance, and prestige. In summary, the 2010 BMW E60 continues to embody BMW's commitment to creating vehicles that deliver an exceptional driving experience. With its iconic design, luxurious interior, and engaging performance, the E60 remains a symbol of BMW's dedication to producing vehicles that cater to enthusiasts and luxury-seekers alike.", 2993.0, 9.0, 1, 286.0, "https://i.pinimg.com/originals/51/62/d5/5162d58a4f273c8ce26544da15659b5d.jpg", "BMW", "E60", 18500.0, 190.0, null, null, null, 250.0, 580.0, 1, 1660.0, 2010 },
                    { 243, 5.0999999999999996, 2, "White", 21, "The Toyota Supra, introduced in 1993, is an iconic sports car that embodies Toyota's pursuit of performance, style, and innovation. With its distinctive design, the Supra carries an unmistakable presence on the road. The sleek and aerodynamic body lines reflect both form and function, showcasing a blend of elegance and sportiness. Inside the Supra, the driver-focused cockpit emphasizes a connection between the driver and the road. High-quality materials, supportive seating, and intuitive controls create an environment that caters to both performance and comfort. Under the hood, the Supra offers a robust and turbocharged engine, delivering exhilarating acceleration and a thrilling driving experience. The precise handling and balanced suspension system make it a joy to navigate winding roads and tracks alike. While safety features in the 1993 Supra might not be as advanced as those in modern cars, it offers essential features like airbags and anti-lock brakes to ensure a level of occupant protection. As a part of Toyota's lineup, the Supra remains a symbol of the brand's dedication to engineering excellence and innovation. It's a coveted choice for enthusiasts and drivers seeking a sports car that offers both performance and prestige. In conclusion, the 1993 Toyota Supra stands as a testament to Toyota's commitment to creating a sports car that excites and inspires. With its iconic design, thrilling performance, and driver-focused interior, the Supra continues to hold a special place in the hearts of automotive enthusiasts and remains a timeless representation of Toyota's dedication to delivering excitement on the road.", 2997.0, 14.6, 2, 330.0, "https://media.suara.com/pictures/653x366/2019/05/23/91189-toyota-supra-mk4.jpg", "Toyota", "Supra", 60000.0, 300.0, null, null, null, 250.0, 440.0, 2, 1570.0, 1993 },
